Brothers Come on! Warriors are looking forward to your challenge here!

Magic Revolution is a single player, turn based strategy, magic fantasy game.

- You play as a wizard fighting against three other AI opponents;
- You choose and learn from the five elements magic (Metal, Wood, Water, Fire & Earth) that each has natural overcoming effect against another;
- You hire Heroes with special abilities to fight with you during the game;
- You build new Cities, expand your Army and conquer the world!

My 4th homemade game. Featuring colleagues from my office as random Heroes characters. Let them assist your adventure in the Magic Revolution, they are awesome! :)

[Note: Although this game runs on iPad 2 mini, iPad Air (first generation), iPhone 5S and earlier, it is not recommended as it will play at a pretty low speed due to their hardware spec.]

Playing chess on a round board for 2 players

Try playing chess on an unusual round board. Test your logic, learn how to play in unusual conditions. A new board game for 2 players. Try playing chess on a round board, this is a new interesting game.

Rules of the game:

• The pawn goes 1 square ahead, beats obliquely;
• The horse walks as usual in chess;
• the elephant walks as usual in chess;
• the queen goes like an elephant and a king;
• The king walks by 1 cage in any direction.

The object of the game is to remove the enemy king.

This game develops logical thinking, allows you to learn to think in unusual conditions. The game is designed for children and adults. Playing chess on a round board will diversify your leisure time.
